import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import AboutMe from '../AboutMe';
import Caro from '../MyCarousel';

function Test() {
  return (
    <>
      <HeroSection />
      <AboutMe/>
      <Caro />
      <Cards />
      <Footer />
    </>
  );
}

export default Test;
